<?php 
require_once '../vendor/autoload.php';
$uibase64 = new \Jsnlib\UploadImageBase64;

// 基本用法

$uibase64
    ->setting(
    [
        'base64'   => '', 
        'filename' => 'TEST.png',
        'path'     => 'images',
        'mode'     => 0777
    ])
    ->save();

print_r($uibase64->result());
/*
    Array 
    ( 
        [base64img] => Array 
            ( 
                [0] => images\TEST.png 
            ) 
    )
*/

echo "<br>";

// 縮圖用法
$uibase64
    ->setting(
    [
        'base64'   => '', 
        'filename' => 'TEST.png',
        'path'     => 'images',
        'mode'     => 0777
    ])
    ->save()
    ->resize(100, 100, 10, 'images', "s2.jpg")
    ->copy(0777);

print_r($uibase64->result());
/*
    Array
    (
        [base64img] => Array
            (
                [0] => images\TEST.png
                [1] => images\TEST.png
            )

        [copy] => ArrayObject Object
            (
                [storage:ArrayObject:private] => Array
                    (
                        [0] => images\s2.jpg
                    )
            )
    )
*/